function footer(){
	var line_width = 36,
			footer_w = 4000,
			count = Math.ceil(footer_w / line_width);

	$('.footer__images i').remove();

	for (var i = 0; i < count; i++){
		var line_number = Math.floor(Math.random() * 45) + 1,
				new_i = document.createElement('i');

		$(new_i).attr('data-id', i).css('background-image', 'url(assets/img/lines/line-'+ line_number +'.png)');
		$(new_i).appendTo($('.footer__images'));
	}
};

