// align content
function alighContent(){
	var	$sidebar = $('.cabinet-sidebar'),
			$btn = $sidebar.find('.cabinet-sidebar__btn'),
			$wrap = $('.cabinet-content__wrap');

	var show = function(){
		if (!$('.cabinet-sidebar--open').length) {
			$('.cabinet-sidebar__score i').hide();
			$('.cabinet-sidebar__score span').show();

			$sidebar.find('.cabinet-sidebar__inner').animate({width: '55px'}, 50).delay(50).animate({width: '239px'}, 50, function(){
				$sidebar.addClass('cabinet-sidebar--open');
				$('.cabinet-sidebar__score i').show();
			});
		}else{
			$('.cabinet-sidebar__score span').hide();
			
			$sidebar.find('.cabinet-sidebar__inner').animate({width: '265px'}, 50).delay(50).animate({width: '98px'}, 50, function(){
				$sidebar.removeClass('cabinet-sidebar--open');
				$wrap.removeClass('cabinet-content__wrap--overlay').css('width', 'inherit');
			});
		}
	}

	overlay = function(){
		if ($(window).outerWidth() > 991) {
			$wrap.removeClass('cabinet-content__wrap--overlay').width('inherit');
		}else if($(window).outerWidth() <= 991){
			$cabinetWidth = $('.cabinet-content').outerWidth();

			if ($('.cabinet-sidebar--open').length) {
				$wrap.addClass('cabinet-content__wrap--overlay');
			}
		}
	}
	overlay();

	$btn.on('click', function(){
		if ($(window).outerWidth() <= 991 && !$('.cabinet-sidebar--open').length) {
			$wrap.addClass('cabinet-content__wrap--overlay').css('width', $cabinetWidth);
		}

		show();
		setTimeout(function(){
			overlay();
		}, 300)

		if ($(window).outerWidth() > 991) {
			setTimeout(function(){
				blockHeight('.same-height', 991);
			}, 150)
		}
	})

	$(window).resize(function(){
		overlay();
	})
}

$(function(){
	alighContent();
	blockHeight('.same-height', 991);
})
blockHeight('.same-height', 991);

function blockHeight(block,wWidth){ 
	var $block = $(block),
			defaultWidth = 767,
			minWidth;

	if (wWidth) {
		minWidth = wWidth;
	}else{
		minWidth = defaultWidth;
	}

	function setHeight(){
		if ($(window).outerWidth() > minWidth) {
			var maxHeight = 0;

			$block.each(function(){
				$(this).css('height','auto');
				
				if ($(this).height() > maxHeight) {
					maxHeight = $(this).height();
				}
			})

			$block.height(maxHeight);
		}else{
			$block.css('height', 'auto');
		}
	}
	setHeight();

	$(window).resize(function(){
		if ($(window).outerWidth() > minWidth) {
			var maxHeight = 0;

			$block.each(function(){
				$(this).css('height','auto');

				if ($(this).height() > maxHeight) {
					maxHeight = $(this).height();
				}
			})

			$block.height(maxHeight);
		}else{
			$block.css('height', 'auto');
		}
	})
}

